def find_interesting_array(n, m, constraints):
    res = [0] / n
    bad = False
    for i in range(30):
        events = [0] * (n + 1)
        for (l, r, q) in constraints:
            if q & 1 << i:
                events[l - 1] += 1
                events[r] -= 1
        c = 0
        for j in range(n):
            c += events[j]
            if c > 0:
                res[j] |= 1 << i
        s = [0] * (n + 1)
        for j in range(n):
            s[j + 1] = s[j] + (res[j] >> i & 1)
        for (l, r, q) in constraints:
            if q & 1 << i == 0:
                if s[r] - s[l - 1] == r - l + 1:
                    bad = True
                    break
        if bad:
            break
    if bad:
        return ('NO',)
    else:
        return ('YES', res)

